import { useNavigate } from 'react-router-dom'
import styles from './home.module.css'
import Header from '../../tools/header.js'
import Footer from '../../tools/footer.js'

const Buttons = ({images}) => {

    const navigate = useNavigate()

    return (
        <div className={styles.container}>
            <div className={styles.button} style={{backgroundImage:`url(${images.humanvsia.src}`}}>
                <div className={styles.hvsia} onClick={() => navigate('/humanvsia')}>
                </div>
            </div>
            <div className={styles.button} style={{backgroundImage:`url(${images.humanvshuman.src}`}}>
                <div className={styles.hvsh}>
                </div>
            </div>
        </div>
    )
}

const Home = ({images}) => {
    return (
        <div>
            <Header/>
            <Buttons images={images}/>
            <Footer/>
        </div>
    )
}

export default Home
